import React, { Fragment } from "react";
import PropTypes from "prop-types";

const ProfileAbout = props => {
  return (
    <div class="profile-about bg-light p-2">
      {props.profile.bio && (
        <Fragment>
          {" "}
          <h2 class="text-primary">
            {" "}
            <span>{props.profile.user.name}</span>'s Bio
          </h2>
          <p>{props.profile.bio}</p>
        </Fragment>
      )}

      <div class="line"></div>
      {props.profile.skills.lenght > 0 && (
        <Fragment>
          <div class="skills">
            {props.profile.skills.map(skill => {
              return (
                <div class="p-1">
                  <i class="fa fa-check"></i> {skill}
                </div>
              );
            })}

            {/* <div class="p-1">
          <i class="fa fa-check"></i> CSS
        </div>
        <div class="p-1">
          <i class="fa fa-check"></i> JavaScript
        </div>
        <div class="p-1">
          <i class="fa fa-check"></i> Python
        </div>
        <div class="p-1">
          <i class="fa fa-check"></i> C#
        </div> */}
          </div>
        </Fragment>
      )}
      <h2 class="text-primary">Skill Set</h2>
    </div>
  );
};

ProfileAbout.propTypes = {
  profile: PropTypes.object.isRequired
};

export default ProfileAbout;
